  class Sintactico
  {
    public List<ListaToken> lista;
    public TablaSimbolos tabla_simbolos = new TablaSimbolos();
    
		public Sintactico(List<ListaToken> miListaToken)
    {
        this.lista = miListaToken;
    }
		
		public void ImprimirTablaSimbolos(TablaSimbolos ts){
			MessageBox.Show("Sin errores.", "Aviso");
			
      string mensaje = "";
      foreach (var clase in ts.tablaSimbolosClase.Values){
        // Clases en la tabla de simbolos
        mensaje += clase.miAlcance+" class "+clase.lexema;
        if (clase.herencia != null)
        {
          mensaje += " : "+clase.herencia.lexema;
        }
        mensaje += "\n";

        mensaje += "Atributos:\n";
        foreach (var atributo in clase.TablaSimbolosAtributos.Values)
        {
          // Atributos en la clase
          mensaje += "\t"+atributo.miAlcance+" "+atributo.miTipo+" "+atributo.lexema;
          if (atributo.valor != null)
          {
              mensaje += " = "+atributo.valor;
          }
          mensaje += "\n";
            
        }
        
        mensaje += "Metodos:\n";
        foreach (var metodo in clase.TablaSimbolosMetodos)
        {
          // Atributos en la clase
          mensaje += "\t"+metodo.miAlcance+" "+metodo.miRegreso+" "+metodo.lexema+"(";
          foreach (var parametro in metodo.TablaSimbolosVariables.Values)
          {
              mensaje += parametro.miTipo+" "+parametro.lexema+", ";
          }
          mensaje += ")";
          mensaje += "\n";
        }
      }

			MessageBox.Show(mensaje, "Tabla de simbolos");
		}

    public TipoDato ObtenerTipoDato(string palabra){
      switch (palabra)
      {
        #region string
        case "string":
          return TipoDato.Cadena;
        #endregion
        
        #region char
        case "char":
          return TipoDato.Caracter;
        #endregion
        
        #region int
        case "int":
          return TipoDato.Entero;
        #endregion
        
        #region float
        case "float":
          return TipoDato.Flotante;
        #endregion
        
        #region double
        case "double":
          return TipoDato.Doble;
        #endregion

        #region bool
        case "bool":
          return TipoDato.Booleano;
        #endregion

        default:
          return new TipoDato();
      }
    }

    public Regreso ObtenerRegreso(string palabra){
      switch (palabra)
      {
        #region string
        case "string":
          return Regreso.Cadena;
        #endregion
        
        #region char
        case "char":
          return Regreso.Caracter;
        #endregion
        
        #region int
        case "int":
          return Regreso.Entero;
        #endregion
        
        #region float
        case "float":
          return Regreso.Flotante;
        #endregion
        
        #region double
        case "double":
          return Regreso.Doble;
        #endregion

        #region bool
        case "bool":
          return Regreso.Booleano;
        #endregion
        
        #region void
        case "void":
          return Regreso.Vacio;
        #endregion

        default:
          return new Regreso();
      }
    }

    public TablaSimbolos AnalizadorSintactico()
    {

      int columna = 0;
      int estado = 103, estadoAnterior=0;

			//Nodos para insertar a la tabla de simbolos.
      NodoClase nodo_clase = new NodoClase();
      NodoClase clase_anterior = new NodoClase();

      NodoMetodo nodo_metodo = new NodoMetodo();
      NodoAtributo nodo_atributo = new NodoAtributo();
      NodoVariables nodo_variable = new NodoVariables();
      List<NodoVariables> parametros = new List<NodoVariables>();

      //Variables para llenar nodos.
      string lexema = "";
      Alcance alcance = Alcance.publico;
			Regreso regreso = new Regreso();
			TipoDato tipo_dato = new TipoDato();
      bool adentro_de_parentesis = false;
      int ambito = 0;

      for (int i = 0; i < lista.Count; i++)
      {
        // Cadenas y caracteres simples
        if ((lista[i].Token >= 100) && (lista[i].Token <= 152))
        {
          if (lista[i].Lexema == "(" || lista[i].Lexema == ")")
          {
              adentro_de_parentesis = !adentro_de_parentesis;
          }
          if (lista[i].Lexema == "{")
          {
              ambito++;
          }
          if (lista[i].Lexema == "}")
          {
              ambito--;
          }
          
          if (lista[i].DescripcionToken == "Cadena" && !adentro_de_parentesis && ambito <= 2)
          {
            if (lista[i+1].Lexema == "(")
            {
              // Metodos y Parametros
              lexema = lista[i].Lexema;

              for (int indice_param = i+1; lista[indice_param].Lexema != ")"; indice_param++)
              {
                if (lista[indice_param].DescripcionToken == "Reservada")
                {
                  nodo_variable.miTipo = ObtenerTipoDato(lista[indice_param].Lexema);
                }
                if (lista[indice_param].DescripcionToken == "Cadena")
                {
                  nodo_variable.lexema = lista[indice_param].Lexema;
                  nodo_variable.miAlcance = Alcance.publico;
                  nodo_variable.tipoVariable = TipoVariable.Parametro;

                  parametros.Add(nodo_variable);
                  nodo_variable = new NodoVariables();
                }
              }
              
              if (lexema == clase_anterior.lexema)
              {
                // El metodo se llama igual que la clase en la que esta.
                MessageBox.Show("Error en la linea "+lista[i].NumeroLinea+"\nMensaje de error: El metodo se llama igual que la clase en la que esta", "Error!");
              }
              else if (tabla_simbolos.ExisteMetodo(lexema, parametros, clase_anterior))
              {
              	// Ya existe un metodo igual.
                MessageBox.Show("Error en la linea "+lista[i].NumeroLinea+"\nMensaje de error: Ya existe un metodo igual", "Error!");
              }
              else
              {
                nodo_metodo.lexema = lexema;
                nodo_metodo.miAlcance = alcance;
                nodo_metodo.miRegreso = regreso;

                tabla_simbolos.InsertarNodoMetodo(nodo_metodo, parametros, clase_anterior);
                nodo_metodo = new NodoMetodo();
              }
              parametros.Clear();
            }
            else if (lista[i+1].Lexema == "=" || lista[i+1].Lexema == ";")
            {
              // Atributo
              lexema = lista[i].Lexema;
              if (lexema == clase_anterior.lexema)
              {
                // El atributo se llama igual que la clase en la que esta.
                MessageBox.Show("Error en la linea "+lista[i].NumeroLinea+"\nMensaje de error: El atributo se llama igual que la clase en la que esta", "Error!");
              }
              else if (tabla_simbolos.ExisteAtributo(lexema, clase_anterior))
              {
                // Ya existe un atributo que se llama igual.
                MessageBox.Show("Error en la linea "+lista[i].NumeroLinea+"\nMensaje de error: Ya existe un atributo que se llama igual", "Error!");
              }
              else
              {
                nodo_atributo.lexema = lexema;
                nodo_atributo.miAlcance = alcance;
                nodo_atributo.miTipo = tipo_dato;

                tabla_simbolos.InsertarNodoAtributo(nodo_atributo, clase_anterior);
                nodo_atributo = new NodoAtributo();
              }
            }
          }

					columna = lista[i].Token - 99;
				}

        //Palabras reservadas
        else if ((lista[i].Token >= 200) && (lista[i].Token <= 277))
        {
					switch (lista[i].Lexema)
					{
            //Alcance
						case "private":
							alcance = Alcance.privado;
							break;
						default:
							//por default, todo es publico.
							alcance = Alcance.publico;
							break;
					}
          
          tipo_dato = ObtenerTipoDato(lista[i].Lexema);
          regreso = ObtenerRegreso(lista[i].Lexema);

          if (lista[i].Lexema == "class")
          {
            lexema = lista[i+1].Lexema;
            if (tabla_simbolos.ExisteClase(lexema))
            {
              // Error, la clase ya existe
              MessageBox.Show("Error en la linea "+lista[i].NumeroLinea+"\nMensaje de error: Ya existe una clase declarada con ese nombre", "Error!");
              break;
            }
            else
            {
              nodo_clase.lexema = lexema;
              nodo_clase.miAlcance = alcance;

              if (i+3 < lista.Count && lista[i+2].Lexema == ":")
              {
                if (tabla_simbolos.ExisteClase(lista[i+3].Lexema))
                {
                  nodo_clase.herencia = tabla_simbolos.ObtenerNodoClase(lista[i+3].Lexema);  
                }
                else
                {
                  MessageBox.Show("Error en linea "+lista[i].NumeroLinea+"\nMensaje de error: No existe la clase a heredar", "Error!");
                  break;
                }
              }
              tabla_simbolos.InsertarNodoClase(nodo_clase);
              clase_anterior = nodo_clase;
              nodo_clase = new NodoClase();
            }

          }

          columna = lista[i].Token - 148;
        }

        // Char
        else if(lista[i].Token == 496)
        {
          lexema = lista[i].Lexema;
          columna = 130;
        }

        // String
        else if (lista[i].Token == 497)
        {
          lexema = lista[i].Lexema;
          columna = 131;
        }

        estadoAnterior = estado;
        estado = MatrizTransicionSintactico(estado, columna);

        if (estado == 0)
        {
          MessageBox.Show("Error en la linea "+lista[i].NumeroLinea+"\nEstado anterior: " + estadoAnterior +", Mensaje de error: " + Errores[estadoAnterior], "Error!");
          break;
        }
      }
			if (estado != 0)
			{
				ImprimirTablaSimbolos(tabla_simbolos);
			}
			return tabla_simbolos;
    }

